import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import './MaldivesLandingPage.css'; // Custom CSS for styling

function MaldivesLandingPage() {
  return (
    <div className="maldives-landing">
      <Container>
        <Row>
          <Col md={6}>
            <h1>Welcome to Maldives</h1>
            <p>Experience the beauty of the Maldives</p>
            <Button variant="primary">Book Now</Button>
          </Col>
          <Col md={6}>
            <img
              src="https://imgs.search.brave.com/CRR5OBtJPLBMXDYWG7ZOyBrM034PbF-MF-0u_LD7XzM/rs:fit:860:0:0/g:ce/aHR0cHM6Ly9mcmVl/NGt3YWxscGFwZXJz/LmNvbS91cGxvYWRz/L3dhbGxwYXBlci9t/YWxkaXZlcy1iZWFj/aC13YWxscGFwZXIt/MTAyNHg3Njgtd2Fs/bHBhcGVyLmpwZw" // Replace with actual image URL
              alt="Maldives Beach"
              className="img-fluid"
            />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default MaldivesLandingPage;
